if IsDuplicityVersion() then
	local Suits = {"Spades", "Hearts", "Clubs", "Diamonds"}
	local Cards = {"Ace", "2", "3", "4", "5", "6", "7", "8", "9", "10", "Jack", "Queen", "King"}

	Chat.Command("draw", function(source, args, rawCommand)
	    Chat.Message(-1, GetIdentity(source), "^7drew a ^3^*"..Cards[math.random(#Cards)].."^r^0 of ^*^3"..Suits[math.random(#Suits)].."^r^0.", 48, 177, 232, true, "card", 5, source)
	end, false, {Help = "Draw a random card", Params = {}})

	Chat.Command("roll", function(source, args, rawCommand)
	    Chat.Message(-1, GetIdentity(source), "^7rolled a ^*^3"..math.random(6).."^r^0.", 48, 177, 232, true, "dice", 5, source)
	end, false, {Help = "Roll a dice", Params = {}})
else
	Citizen.CreateThread(function()
		Chat.Template("card", "<img src=\"data:image/svg+xml;utf8;base64,\" height=\"16\" />  <b>{0}</b>: {1}")
		Chat.Template("dice", "<img src=\"data:image/svg+xml;utf8;base64,\" height=\"16\" />  <b>{0}</b>: {1}")
	end)
end